import React from 'react'
import images from '../Helpers/Images'

function Carousel() {
  return (
    <div>
      <div className='innerCarousel' style={{width: '80%', height: '200px',
        background: `url(${images[0].img})`}}>
      </div>
    </div>
  )
}

export default Carousel
